import React from 'react';
import { Feed, Icon } from 'semantic-ui-react'

 export const UserShortDisplay=(img)=>{
   return (
            <Feed>
                <Feed.Event>
                    <Feed.Label>
                        <img src={props.img} />
                    </Feed.Label>
                <Feed.Content>
                <Feed.Summary>
                <a>{props.surname} {props.lastname}</a>
                </Feed.Summary>
                <Feed.Meta>
                    <Feed.Like>
                    <Icon name='money bill alternate outline' />{props.money}
                    </Feed.Like>
                </Feed.Meta>

                </Feed.Content>

                </Feed.Event>
            </Feed>
            );
    }
